########################################
# Include configuration
########################################
[include fluidd.cfg]
[include sensorless.cfg]
[include useful_macros.cfg]
[include start_end.cfg]
[include Line_Purge.cfg]
[include Smart_Park.cfg]
[include fan_control.cfg]
[include timelapse.cfg]
[include mmu.cfg]
[include cartotouch.cfg]
[include loadcell_probe.cfg]
[include Input Shaper/input_shaper.cfg]
[include Motor.cfg]
[include MyCustomMacros.cfg]
[include obico/moonraker_obico_macros.cfg]

[printer]
kinematics: corexy
max_velocity: 800
max_accel: 25000
max_z_velocity: 25
max_z_accel: 500
square_corner_velocity: 5

[exclude_object]

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_2C0034001551303531313638-if00
baud: 250000
restart_method: command

[mcu nozzle_mcu]
serial: /dev/serial/by-id/usb-FTDI_FT232R_USB_UART_A9M3FZ3O-if00-port0
baud: 250000
restart_method: command
#python3 mcu_util.py -b -v -i /dev/serial/by-id/usb-FTDI_FT232R_USB_UART_A9M3FZ3O-if00-port0 -u -f /home/klipper/k1-klipper-firmware/outfw/noz0_120_G30-noz0_021_000.bin

[virtual_sdcard]
path: /home/klipper/printer_K1_data/gcodes
on_error_gcode: CANCEL_PRINT

[save_variables]
filename: /home/klipper/printer_K1_data/config/save_variables.cfg

[gcode_arcs]
resolution: 0.1

[verify_heater extruder]
[verify_heater heater_bed]
check_gain_time: 600
heating_gain: 0.1
hysteresis: 50

[filament_switch_sensor filament_sensor]
pause_on_runout: false
switch_pin: !nozzle_mcu:PA10

########################################
# Motor configuration (Extruders)
########################################

[extruder]
max_extrude_only_distance: 2000.0
max_extrude_cross_section: 80
#step_pin: PA10
#dir_pin: !PA9
#enable_pin: !PA15
step_pin: nozzle_mcu:PB1
dir_pin: nozzle_mcu:PB0
enable_pin: !nozzle_mcu:PB2
microsteps: 32
rotation_distance: 6.9
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: nozzle_mcu:PB7
sensor_type: EPCOS 100K B57560G104F
sensor_pin: nozzle_mcu:PA0
pressure_advance: 0.04
pressure_advance_smooth_time: 0.01
#control: mpc
heater_power: 60  
cooling_fan: fan_generic part
filament_density: 1.26
filament_heat_capacity: 1.8 
min_extrude_temp: 5
min_temp: 0
max_temp: 350

[autotune_tmc extruder]
motor: qidi-BJY36D12-04V13
tuning_goal: performance
extra_hysteresis: 0
TBL: 2
TOFF: 5
#sgt: 1
sg4_thrs: 95
pwm_freq_target: 55e3
voltage: 24
#overvoltage_vth: 0.0 to 60.0

[heater_bed]
heater_pin: PF5
sensor_pin: PB1 # TB
sensor_type: EPCOS 100K B57560G104F
#control: mpc
heater_power: 230
min_temp: 0
max_temp: 120

########################################
# TMC2209 configuration
########################################

[tmc2209 extruder]
#uart_pin: PD6
uart_pin: nozzle_mcu:PB11
tx_pin: nozzle_mcu:PB10
uart_address: 3
run_current: 0.55
sense_resistor: 0.100
#stealthchop_threshold: 0
# driver_IHOLDDELAY: 8
# driver_TPOWERDOWN: 20
# driver_TBL: 2
# driver_TOFF: 3
# driver_HEND: 0
# driver_HSTRT: 5

